import React from "react";
import { MDBContainer, MDBFooter, MDBCol, MDBRow } from "mdbreact";

const FooterAP = () => {
  const Styles = {
    link: {
      color: "#fffff",
    },
    redes: {
      fontSize: "50px",
    },
  };

  return (
    <>
      <MDBFooter color="cyan" className="font-small darken-3 pt-0">
        <MDBContainer>
          <MDBRow>
            <MDBCol md="12" className="py-5">
              <div className="mb-5 flex-center">
                <a className="fb-ic">
                  <i className="fab fa-facebook-f fa-lg white-text mr-md-5 mr-3 fa-2x"></i>
                </a>
                <a className="tw-ic">
                  <i className="fab fa-twitter fa-lg white-text mr-md-5 mr-3 fa-2x"></i>
                </a>
                <a className="gplus-ic">
                  <i className="fab fa-google-plus fa-lg white-text mr-md-5 mr-3 fa-2x"></i>
                </a>
                <a className="li-ic">
                  <i className="fab fa-linkedin-in fa-lg white-text mr-md-5 mr-3 fa-2x"></i>
                </a>
                <a className="ins-ic">
                  <i className="fab fa-instagram fa-lg white-text mr-md-5 mr-3 fa-2x"></i>
                </a>
                <a className="pin-ic">
                  <i className="fab fa-pinterest fa-lg white-text fa-2x"> </i>
                </a>
              </div>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
        <div className="footer-copyright text-center py-3">
          <MDBContainer fluid>
            Copyright: &copy; {new Date().getFullYear()}
            <a
              style={Styles.link}
              href="https://www.linkedin.com/in/alejandro-guespud/"
            >
              {" "}
              Alejandro Guespud{" "}
            </a>
          </MDBContainer>
        </div>
      </MDBFooter>
    </>
  );
};

export default FooterAP;
